const HomePage = () => {
    return (
        <div className='font' >
            <Slider />
            <HomeCategory />
            <CardProductContainer title="الاكثر مبيعا " btntitle="المزيد" pathText=""/>
            <Discount />
            <CardProductContainer title=" احدث الازياء " btntitle="المزيد"/>
            <BrandFeatured title=" اشهر الماركات " btntitle="المزيد"/>
        </div>
    );
};

export default HomePage;
